import React, {useEffect, useState} from 'react'
import {getStudents} from '../services/StudentService' 
import axios from 'axios';

const ListStudentComponent = () => {
    const STUDENT_API_BASE_URL = "http://localhost:8443/students";
    const AuthStr = 'Bearer '.concat("eyJhbGciOiJIUzUxMiJ9.eyJzdWIiOiIxOTQ2NDA4NjE2IiwiZXhwIjoxNzI1ODc4NjU5LCJpYXQiOjE3MjU4NzgwNTl9.aBeHe-Bc-mhckTQSq1tJKacvuavmYzhD9aFfPXDNkNTjHjY_mQvknl6EhgjXuC0kheVkEnD_xTOczR_b3y11_A"); 
    const dummyData = axios.get(STUDENT_API_BASE_URL, { headers: { Authorization: AuthStr } })
     .then(response => {
         // If request is good...
         console.log(response.data);
      })
     .catch((error) => {
         console.log('error ' + error);
      });



    return (

        <div className='container'>
                 <h2 className="text-center">Student List</h2>
                 <br></br>
                 <div className = "row">
                        <table className = "table table-striped table-bordered">

                            <thead>
                                <tr>
                                    <th> Student Id</th>
                                    <th> Student Name</th>
                                    <th> Student Contact Number</th>
                                    <th> Student Address</th>
                                    <th> Student Pincode</th>
                                </tr>
                            </thead>
                            <tbody>
                                {
                                    dummyData.data.map(
                                        student => 
                                        <tr key = {student.id}>
                                             <td> {student.id}</td>
                                             <td> { student.name} </td>   
                                             <td> {student.contactNumber}</td>
                                             <td> {student.address}</td>
                                             <td> {student.pincode}</td>
                                        </tr>
                                    )
                                }
                            </tbody>
                        </table>

                 </div>

            </div>


  )
}

export default ListStudentComponent
